import React, {memo} from 'react';
import styled from 'styled-components';

const IndexContainer = styled.div``;

const index = memo(() => {
  return (
    <IndexContainer>
        <Header />
        <h1>index</h1> 
        <Footer />
    </IndexContainer>
  );
});

export default index;
